import React from "react";
import { useParams } from 'react-router-dom';

const Dentist = () => {
  const { id } = useParams(); // Obtén el ID del dentista de la URL

  return (
    <div>
      <h2>Detail Dentista</h2>
      <p>ID del Dentista: {id}</p>
      {/* Renderiza los detalles del dentista utilizando el ID para obtener los datos */}
    </div>
  );
};

export default Dentist;
